pragma solidity ^0.4.2;

import "./ERC721.sol";

contract PlayerFactory is ERC721 {

    uint8 maximumPlayer = 5;

    uint uniqueDigits = 2; // Keep uniqueId string as 2-digit number to implement some functions based on its uniquesness later
    uint uniqueModulus = 10 ** uniqueDigits;
    uint8 skillModulus = 26; // 256 / 26 = 0 -> 10

    struct Player {
        // General information
        string name;
        uint8 pass;
        uint8 shoot;
        uint8 defense;
        // Unique properties
        uint uniqueId;
    }

    event NewPlayerCreated(
        uint playerId,
        string name,
        uint8 pass,
        uint8 shoot,
        uint8 defense,
        uint uniqueId
    );

    Player[] public players;

    mapping (uint => address) public playerToOwner;
    mapping (uint => address) public playerToApprovedOwner;
    mapping (address => uint) public ownerToPlayerCount;

    // ============= Modifiers ================

    modifier validPlayerCount(address _owner) {
        require(ownerToPlayerCount[_owner] <= maximumPlayer);
        _;
    }

    modifier couldAddMorePlayer(address _owner) {
        require(ownerToPlayerCount[_owner] + 1 <= maximumPlayer);
        _;
    }

    // ============= ERC-721 compliance ================

    event Transfer(address from, address to, uint256 tokenId);
    event Approval(address owner, address approved, uint256 tokenId);

    /// @notice Returns the total number of Kitties currently in existence.
    /// @dev Required for ERC-721 compliance.
    function totalSupply() public view returns (uint) {
        return players.length - 1;
    }

    /// @notice Returns the number of Kitties owned by a specific address.
    /// @param _owner The owner address to check.
    /// @dev Required for ERC-721 compliance
    function balanceOf(address _owner) public view returns (uint256 count) {
        return ownerToPlayerCount[_owner];
    }

    /// @notice Returns the address currently assigned ownership of a given Kitty.
    /// @dev Required for ERC-721 compliance.
    function ownerOf(uint256 _tokenId)
        external
        view
        returns (address owner)
    {
        owner = playerToOwner[_tokenId];

        require(owner != address(0));
    }

    /// @notice Grant another address the right to transfer a specific Kitty via
    ///  transferFrom(). This is the preferred flow for transfering NFTs to contracts.
    /// @param _to The address to be granted transfer approval. Pass address(0) to
    ///  clear all approvals.
    /// @param _tokenId The ID of the Kitty that can be transferred if this call succeeds.
    /// @dev Required for ERC-721 compliance.
    function approve(
        address _to,
        uint256 _tokenId
    )
        external
    {
        // Only an owner can grant transfer approval.
        require(_owns(msg.sender, _tokenId));

        // Register the approval (replacing any previous approval).
        _approve(_tokenId, _to);

        // Emit approval event.
        Approval(msg.sender, _to, _tokenId);
    }

    /// @notice Transfers a Kitty to another address. If transferring to a smart
    ///  contract be VERY CAREFUL to ensure that it is aware of ERC-721 (or
    ///  CryptoKitties specifically) or your Kitty may be lost forever. Seriously.
    /// @param _to The address of the recipient, can be a user or contract.
    /// @param _tokenId The ID of the Kitty to transfer.
    /// @dev Required for ERC-721 compliance.
    function transfer(
        address _to,
        uint256 _tokenId
    )
        external
    {
        // Safety check to prevent against an unexpected 0x0 default.
        require(_to != address(0));
        // Disallow transfers to this contract to prevent accidental misuse.
        // The contract should never own any kitties (except very briefly
        // after a gen0 cat is created and before it goes on auction).
        require(_to != address(this));

        // You can only send your own cat.
        require(_owns(msg.sender, _tokenId));

        // Reassign ownership, clear pending approvals, emit Transfer event.
        _transfer(msg.sender, _to, _tokenId);

        Transfer(msg.sender, _to, _tokenId);
    }

    /// @notice Transfer a Kitty owned by another address, for which the calling address
    ///  has previously been granted transfer approval by the owner.
    /// @param _from The address that owns the Kitty to be transfered.
    /// @param _to The address that should take ownership of the Kitty. Can be any address,
    ///  including the caller.
    /// @param _tokenId The ID of the Kitty to be transferred.
    /// @dev Required for ERC-721 compliance.
    function transferFrom(
        address _from,
        address _to,
        uint256 _tokenId
    )
        external
    {
        // Safety check to prevent against an unexpected 0x0 default.
        require(_to != address(0));
        // Disallow transfers to this contract to prevent accidental misuse.
        // The contract should never own any kitties (except very briefly
        // after a gen0 cat is created and before it goes on auction).
        require(_to != address(this));
        // Check for approval and valid ownership
        require(_owns(_from, _tokenId));

        // Reassign ownership (also clears pending approvals and emits Transfer event).
        _transfer(_from, _to, _tokenId);
    }



    // ============= Private / Internal functions ================
    /// @dev For private/ internal functions, we shouldn't handle error check, validating, etc.
    ///  This should be checked before calling these functions

    /// @dev Assigns ownership of a specific Kitty to an address.
    function _transfer(address _from, address _to, uint256 _tokenId) internal {
        playerToOwner[_tokenId] = _to;

        ownerToPlayerCount[_to]++;
        ownerToPlayerCount[_from]--;

        // Since this player has been transfer, so delete all previously approved owner
        delete playerToApprovedOwner[_tokenId];

        Transfer(_from, _to, _tokenId);
    }

    function _approve(uint _tokenId, address _approved) internal {
        playerToApprovedOwner[_tokenId] = _approved;
    }

    function _owns(address _owner, uint _tokenId) internal view returns (bool) {
        return playerToOwner[_tokenId] == _owner;
    }

    function _createPlayer(
        string _name,
        uint8 _pass,
        uint8 _shoot,
        uint8 _defense,
        uint _uniqueId
    )
        internal
        returns (uint playerId)
    {
        require(ownerToPlayerCount[msg.sender] + 1 <= maximumPlayer);

        Player memory _player = Player({
            name: _name,
            pass: _pass,
            shoot: _shoot,
            defense: _defense,
            uniqueId: _uniqueId
        });

        playerId = players.push(_player) - 1;

        playerToOwner[playerId] = msg.sender;
        ownerToPlayerCount[msg.sender]++;

        NewPlayerCreated(playerId, _name, _pass, _shoot, _defense, _uniqueId);
    }

    function _generateRandomUniqueness(string _str) private view returns (uint _randomUnique) {
        uint rand = uint(keccak256(_str, now)); // Use now here to make sure if user's input are same, they would still provde different hash
        return rand % uniqueModulus;
    }

    function _generateRandomSkill(string _str) private view returns (uint8 _randomSkill) {
        uint8 rand = uint8(keccak256(_str, now));
        return uint8(rand % skillModulus);
    }

    // ============= Public functions ================

    function transferPlayer(
        address _from,
        address _to,
        uint256 _tokenId
    )
        public
    {
        // Safety check to prevent against an unexpected 0x0 default.
        require(_to != address(0));
        // Disallow transfers to this contract to prevent accidental misuse.
        // The contract should never own any kitties (except very briefly
        // after a gen0 cat is created and before it goes on auction).
        require(_to != address(this));
        // Check for approval and valid ownership
        require(_owns(_from, _tokenId));

        // Reassign ownership (also clears pending approvals and emits Transfer event).
        _transfer(_from, _to, _tokenId);
    }

    function createRandomPlayer(string _name) public returns (
        string name,
        uint8 pass,
        uint8 shoot,
        uint8 defense,
        uint uniqueId,
        uint playerId
    ) {
        require(ownerToPlayerCount[msg.sender] + 1 <= maximumPlayer);

        uint randUniqueId = _generateRandomUniqueness(_name);
        uint8 passSkill = _generateRandomSkill(_name);
        uint8 shootSkill = _generateRandomSkill(_name);
        uint8 defenseSkill = _generateRandomSkill(_name);

        playerId = _createPlayer(_name, passSkill, shootSkill, defenseSkill, randUniqueId);

        Player storage player = players[playerId];

        name = player.name;
        pass = player.pass;
        shoot = player.shoot;
        defense = player.defense;
        uniqueId = player.uniqueId;
    }

}
